      border-radius: 50%;
    }

    @keyframes rotate {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }

    .tagline {
      margin-top: 25px;
      font-size: 1.5rem;
      color: #b0ffb0;
      text-shadow: 0 0 8px rgba(144,255,144,0.4);
    }

    .hex-logo {
      margin-top: 25px;
      margin-bottom: 10px;
    }

    .hex-logo img {
      width: 60px;
      height: auto;
    }

    .logo-text {
      margin-top: -20px;
    }

    .logo-text div:first-child {
      font-size: 2rem;
      font-weight: 600;
      letter-spacing: 2px;
    }

    .logo-text div:last-child {
      font-size: 1.2rem;
      letter-spacing: 1px;
      margin-top: -5px;
    }

    .subline {
      margin-top: 10px;
      font-size: 1rem;
      color: #cccccc;
      max-width: 600px;
      line-height: 1.5;
      padding: 0 20px;
    }

    a {
      color: #00BFFF;
      text-decoration: none;
      font-size: 1rem;
      margin-top: 20px;
      display: block;
    }
  
    .star {
      position: absolute;
      width: 2px;
      height: 2px;
      background: #b0ffff;
      border-radius: 50%;
      animation: twinkle 2s infinite ease-in-out;
      opacity: 0.6;
    }

    @keyframes twinkle {
      0%, 100% { opacity: 0.3; transform: scale(1); }
      50% { opacity: 1; transform: scale(1.5); }
    }


    .shooting-star {
      position: absolute;
      width: 100px;
      height: 2px;
      background: linear-gradient(270deg, #b0ffff, rgba(176, 255, 255, 0));
      opacity: 0;
      pointer-events: none;
      transform-origin: left center;
      animation: shoot 1.2s ease-out forwards;
      z-index: 0;
    }

    @keyframes shoot {
      0% {
        opacity: 0;
        transform: translate(0, 0) scaleX(1) rotate(var(--angle, 90deg));
      }
      20% {
        opacity: 1;
      }
      100% {
        opacity: 0;
        transform: translate(var(--dx, 0px), var(--dy, 300px)) scaleX(0.5) rotate(var(--angle, 90deg));
      }
    }

    .copyright {
      position: fixed;
      bottom: 10px;
      width: 100%;
      text-align: center;
      color: #555;
      font-size: 0.75rem;
      letter-spacing: 1px;
      z-index: 5;
    }


    .contact-link {
      color: #00BFFF;
      text-decoration: none;
      font-size: 1rem;
      margin-top: 20px;
      display: block;
      text-shadow: 0 0 8px rgba(0, 191, 255, 0.7), 0 0 12px rgba(0, 191, 255, 0.5);
      animation: pulseGlow 2.5s infinite ease-in-out;
    }

    @keyframes pulseGlow {
      0%, 100% {
        text-shadow: 0 0 8px rgba(0, 191, 255, 0.7), 0 0 12px rgba(0, 191, 255, 0.5);
      }
      50% {
        text-shadow: 0 0 12px rgba(0, 191, 255, 1), 0 0 18px rgba(0, 191, 255, 0.8);
      }
    }

</style>
</head>

  const starCount = 40;
  for (let i = 0; i < starCount; i++) {
    const star = document.createElement('div');
    star.classList.add('star');
    star.style.top = Math.random() * 100 + 'vh';
    star.style.left = Math.random() * 100 + 'vw';
    star.style.animationDelay = (Math.random() * 4) + 's';
    document.body.appendChild(star);
  }
</script>

<script>
  function createShootingStar() {
    const star = document.createElement('div');
    star.classList.add('shooting-star');

    const startX = Math.random() * window.innerWidth;
    const startY = Math.random() * window.innerHeight * 0.3;  // Top 30% of screen
    const angle = 75 + Math.random() * 30;  // Angle between 75° and 105°
    const dx = Math.cos(angle * Math.PI / 180) * 300;
    const dy = Math.sin(angle * Math.PI / 180) * 300;

    star.style.top = startY + 'px';
    star.style.left = startX + 'px';
    star.style.setProperty('--angle', `${angle}deg`);
    star.style.setProperty('--dx', `${dx}px`);
    star.style.setProperty('--dy', `${dy}px`);

    document.body.appendChild(star);
    setTimeout(() => document.body.removeChild(star), 1300);
  }

  setInterval(() => {
    createShootingStar();
  }, 5000);
</script>
